<script type="text/javascript">
/* CONFIG DATA */
var configs = <?=json_encode($configs);?>,
    groups = <?= json_encode($groups) ?>,
    validateDataType = function(configDetails, value) {
        if(configDetails.required && value === ""){
            alert("Config is required. Set a value.");
            return false;
        }
        if(configDetails.dataType === "Integer") {
            var intVal = parseInt(value, 10);
            if(isNaN(intVal) || value !== "" + intVal) {
                alert("Config is a integer type. Use an integer.");
                return false;
            }
            if(configDetails.minVal !== undefined && intVal < configDetails.minVal){
                alert("Config has a minimum value of " + configDetails.minVal);
                return false;
            }
            if(configDetails.maxVal !== undefined && intVal > configDetails.maxVal){
                alert("Config has a maximum value of " + configDetails.maxVal);
                return false;
            }
        }
        else if(configDetails.dataType === "String" && configDetails.maxLength !== undefined && value.length > configDetails.maxLength){
            alert("Config has a maximum length of " + configDetails.maxLength + ". You're over that limit by " + (value.length - configDetails.maxLength) + " characters. Trim the fat.");
            return false;
        }
        return true;
    },
    io;
YUI().use('io', function(Y) {
    inputType = function(configDetails) {
        var input = Y.Node.create('<input>');
        if (configDetails.dataType === 'String') {
            input = Y.Node.create('<textarea>').set('innerHTML', configDetails.currentValue).set('cols', 50);
            if(configDetails.maxLength !== undefined){
                input.set('maxlength', configDetails.maxLength);
            }
        }
        else if (configDetails.dataType === 'Integer') {
            input.set('type', 'number').setAttribute('value', configDetails.currentValue || 0);
            if(configDetails.minVal !== undefined){
                input.set('min', configDetails.minVal);
            }
            if(configDetails.maxVal !== undefined){
                input.set('max', configDetails.maxVal);
            }
        }
        else if (configDetails.dataType === 'Boolean') {
            input.set('type', 'checkbox');
            if (configDetails.currentValue === true) {
                input.setAttribute('checked')
            }
        }
        if(configDetails.required){
            input.set('required', true);
        }
        input.set('id', 'setConfigValue');
        return input.get('outerHTML') || Y.Node.create('<div>').append(input).get('innerHTML');

    };
    io = function(options) {
        var progressInsertionPoint = options.target.ancestor('.yui3-dialog-button-container') || options.target.ancestor();
        progressInsertionPoint.prepend('<img id="loadingIndicator" src="/euf/core/images/indicator.gif"/>', (options.insertAfter) ? 'after' : options.target);
        Y.io(options.url, {
            method: options.method || "POST",
            data: options.data || "",
            on: {
                success: function(id, response) {
                    if(response.responseText && JSON.parse(response.responseText)) {
                        (options.callback && options.callback(response.responseText));
                        Y.one("#loadingIndicator").remove();
                        if(options.successMessage){
                            progressInsertionPoint.prepend(Y.Node.create("<small/>").set("innerHTML", options.successMessage), options.target);
                            Y.later(1500, null, function(){
                                var message = Y.one('.yui3-dialog-button-container small');
                                message && message.remove();
                            });
                        }
                    }
                    else {
                        alert("A problem occurred. Your site is likely messed up. Try again later or something. " + response.responseText);
                    }
                }
            }
        });
    }
});
YUI({gallery: 'gallery-2011.02.09-21-32'}).use('overlay', 'gallery-aui-dialog', 'autocomplete', 'autocomplete-highlighters', function(Y) {
    function populateDialog(result) {
        var saveHandler = function(e, closeAfterSuccess) {
            var inputElement = Y.one('#setConfigValue'), value;
            if(result.dataType === 'Boolean'){
                value = inputElement.get('checked') ? 1 : 0;
            }
            else{
                value = Y.Lang.trim(inputElement.get('value'));
            }
            if(validateDataType(result, value)) {
                io({
                   url:'/ci/admin/internalTools/updateConfig/' + result.name + '/' + encodeURIComponent(value),
                   target: e.target,
                   successMessage: "Success!",
                   callback: function() {
                        if(result.dataType === 'Boolean'){
                            result.currentValue = (value === 1);
                        }
                        else{
                            result.currentValue = value;
                        }
                        if(closeAfterSuccess){
                            Y.later(500, dialog, function(){this.close()});
                        }
                   }
               });
            }
        };
        var buttons = [
            {
                text: 'Save',
                handler: saveHandler
            },
            {
                text: 'Save & Close',
                handler: function(e){
                    saveHandler.call(this, e, true);
                }
            },
            {
                text: 'Close',
                handler: function() {
                    this.close();
                }
            }
        ];
        if(result.currentValue !== result.defaultValue){
            buttons.push({
                text: 'Restore Default',
                handler: function(){
                    Y.one("#setConfigValue").set((result.dataType === 'Boolean' ? 'checked' : 'value'), result.defaultValue);
                }
            });
        }
        var dialog = new Y.Dialog({
                centered: true,
                focused: true,
                destroyOnClose: true,
                title: result.name,
                bodyContent: buildDialogContent(result),
                constrain2view: true,
                width: 500,
                resizable: false,
                height: 380,
                buttons: buttons
            });
        dialog.after("destroy", function() { inputNode.set('value', '').select(); });
        dialog.on("keydown", function(e) { (e.domEvent.keyCode === 27 && this.close()); });
        dialog.render();
        Y.one('#setConfigValue').focus();
    }
    function findConfig(result) {
        for(var i = 0; i < configs.length; i++) {
            if(configs[i].name === result.text) {
                return configs[i];
            }
        }
    }
    function createTagHtml(label, description){
        return '<span class="tag" title="' + description + '">' + label + '</span>';
    }

    function buildDialogContent(configDetails){
        var dialogContent = '<div class="description">' + configDetails.description + '</div>' +
                            '<div class="meta"><b>Default Value</b>: ' + configDetails.defaultValue + '</div>';

        if(configDetails.maxLength !== undefined){
            dialogContent += '<div class="meta"><b>Max Length</b>: ' + configDetails.maxLength + '</div>';
        }
        if(configDetails.minVal !== undefined){
            dialogContent += '<div class="meta"><b>Min Value</b>: ' + configDetails.minVal + '</div>';
        }
        if(configDetails.maxVal !== undefined){
            dialogContent += '<div class="meta"><b>Max Value</b>: ' + configDetails.maxVal + '</div>';
        }

        dialogContent += '<div>' + createTagHtml(configDetails.dataType, "The data type of the config.");
        if(configDetails.sitewide){
            dialogContent += createTagHtml('Site Wide', 'This config applies to the entire site and not just this interface.');
        }
        if(configDetails.hidden){
            dialogContent += createTagHtml('Hidden', 'This config is hidden and therefore cannot be edited directly by customers.');
        }
        if(configDetails.required){
            dialogContent += createTagHtml('Required', 'This config must have a value.');
        }
        dialogContent += '</div><div class="setConfig">' + inputType(configDetails) + '</div>';
        return dialogContent;
    }
    /* AUTOCOMPLETE */
    var inputNode = Y.one('#search');
    inputNode.on('keypress', function(e){
        //When a user presses space, halt the event and put in an underscore instead
        if(e.keyCode === 32){//space
            e.halt();
            inputNode.set('value', inputNode.get('value') + '_');
        }
    })
    inputNode.plug(Y.Plugin.AutoComplete, {
        maxResults: 15,
        resultHighlighter: 'phraseMatch',
        resultFilters: function(query, results){
          return Y.Array.filter(results, function(result) {
              return result.text.toLowerCase().indexOf(query.toLowerCase()) !== -1;
            });
        },
        source: <?=json_encode($autoComplete);?>
    });
    inputNode.ac.on('select', function(e) {
        var result = e.result;
        e.preventDefault();
        inputNode.set('value', result.text);
        inputNode.select();
        inputNode.ac.hide();
        populateDialog(findConfig(result));
    });
    /* BROWSE MESSAGEBASES */
    Y.delegate('click', function(e) {
        e.preventDefault();
        var base = e.target.get('id'),
            data = [], dialogContent = "",
            config, message;
        if(base === 'configs') {
            data = configs;
            config = true;
        }
        else if (base === "groups") {
            Y.Object.each(groups, function(val, key) {
                dialogContent += "<li><b>" + key + "</b><br>" + val + "<button data-group='" + key + "'>Set this group of configs</button></li>";
            });
            dialogContent = "<ul>" + dialogContent + "</ul>";
        }
        else {
            message = true;
            dialogContent = "<form class='searchMB' id='searchMB'>" +
                        "<input type='search' id='searchMessagebase' placeholder='Search'>" +
                        "<input type='submit' value='Search' id='searchForMessage'>" +
                        "</form><ul id='messageResults'></ul>";
        }
        if (config) {
            Y.Array.each(data, function(item) {
                dialogContent += "<li><a href='#' title='" + item.description + "'>" + item.name + "</a></li>";
            });
            dialogContent = "<ul>" + dialogContent + "</ul>";
        }
        var dialog = new Y.Dialog({
            centered: true,
            destroyOnClose: true,
            title: e.target.get('innerHTML'),
            bodyContent: dialogContent,
            constrain2view: true,
            resizable: false,
            height: 500,
            width: 600,
            buttons: [{text: 'Close', handler: function(){this.close();}}]
        });
        dialog.on("keydown", function(e) { (e.domEvent.keyCode === 27 && this.close()); });
        dialog.render();
        Y.one("#" + dialog.get('id')).one('a, input, .yui3-dialog-bd button').focus();
        if(config) {
            Y.delegate("click", function(e) {
                e.preventDefault();
                populateDialog(findConfig({text: e.target.get('innerHTML')}));
            }, "#" + dialog.get('id'), "a");
        }
        else if (message){
            Y.one("#searchForMessage").on("click", function(e) {
                e.preventDefault();
                var messageToSearchFor = Y.Lang.trim(Y.one("#searchMessagebase").get("value")),
                    matchCase, regex;
                if(messageToSearchFor) {
                    io({
                        url: "/ci/admin/internalTools/searchMessagebase/" + encodeURIComponent(messageToSearchFor) + "/" + new Date(),
                        target: e.target,
                        insertAfter: true,
                        method: "GET",
                        callback: function(response) {
                            response = JSON.parse(response);
                            var html = "";
                            Y.Object.each(response, function(value, key) {
                                html += "<li><b>" + key + "</b>: " + value + "</li>";
                            });
                            Y.one("#messageResults").set("innerHTML", html || "<li>No Results</li>");
                        }
                    });
                }
            });
        }
        else {
            // groups
            Y.delegate("click", function(e) {
                io({
                    url: "/ci/admin/internalTools/configGroup/" + e.target.getAttribute("data-group") + '/0',
                    target: e.target,
                    successMessage: "<br>Success! You'll have to refresh the page to see the changes reflected on this page.<br>"
                });
            }, "#" + dialog.get("id"), "button");
        }
    }, '#buckets', 'a');
});
</script>
